import React from 'react';

function Header({ title, subtitle }) {
  const headerStyle = {
    backgroundColor: '#36545d',
    color: 'white',
    padding: '20px',
    textAlign: 'center',
    height: '75px',
  };

  const h1Style = {
    margin: '0',
  };

  const divStyle = {
    marginTop: '5px',
  };

  return (
    <header style={headerStyle}>
      <h1 style={h1Style}>{title}</h1>
      <div style={divStyle}>{subtitle}</div>
    </header>
  );
}

export default Header;
